Happy New Year! The Great New Year Reunion Tradition Continues!  Roger and I meet Dave McKenzie and wife Adele for New Year's brunch and catch up on the year gone by, as well as the past 6 DECADES!  As a big reminder, Dave McKenzie is the New Zealander who WON and SET A COURSE RECORD in the 1967 Boston Marathon. On that cold and sleeting day (think 2018 conditions) "wee Ging" --as they called him as he was  quite small and had bright ginger-red hair--ran a 2:15. Two HOURS later, I finished my first and very controversial marathon.  We didn't meet until 1984 when I met (and married!)  his countryman and often running competitor, Roger Robinson.  Life is so amazing, and often so wonderful!

Cheers, @KathrineSwitzer
💜💜💜
