A long run has always been another traditional way for me to start the New Year. You have a chance to sort out your resolutions and sometimes you find added inspiration on the way.  Like this one, in a small suburban street in Nelson, New Zealnad, I came across  an 'honor' flower stand--$10 and you get a beautiful bouquet and get to keep the jam jar too. Leave the $10 in the pot. Nobody steals the flowers, nobody pilfers the money pot, and the blackboard gives you a little inspiration. The whole system gives me inspiration:  it ASSUMES you are honest and that you love flowers, and like almost everyone in the world, you are hoping that  2023 will be your best year yet! So, YOU can start that happening, by going for a run or walk, and noticing things around you and saying Happy New Year to everyone you meet! Happy New Year!
Cheers, @KathrineSwitzer
🌺 🌸 🌺 🌸 🌺
