Roger and I attended Cathy Troisi's funeral this morning from 9,000 miles away by livestream.  It was 5AM our time, and as the service proceeded, the sun rose here in New Zealand, and I thought how pleased she would have been to be honored by this glorious and appropriate coincidence. As you can see by the display of her hundreds of marathons,  Cathy has walked and run into hundreds of  sunrises and sunsets on her marathon journeys. I'm sure we'll see her out there running still when our own time comes! Photo of Cathy with Roger and me in Yakima, WA, 2014.
Love, 
@KathrineSwitzer
