My friend Cathy Troisi was the ultimate connector of people.  I have just discovered that the author of this wonderful article in the Finger Lakes Times about Cathy is married to Scott Porter, her great runner friend from Seneca Falls, whose photo was featured with me in my first sad post on Cathy's passing. And further, that her friend Katie MacIntyre  became a great friend and a participant on the original 261Fearless charity team for  the big 2017 Boston Marathon, then went on to be the race director for the inaugural Women's Right to Run 19K in Seneca Falls. Cathy left a hole in our lives but she is busy filling it with our friendships! 

https://www.fltimes.com/opinion/remembering-cathy-troisi-more-than-just-a-marathoner/article_259a784c-e11d-57fd-838b-677bf3747668.html

💙💛💙💛💙
