What a great day I had yesterday in Melbourne, Australia visiting my old friend, Erica King, an 'original' with @261Fearless, who ran with our 50th anniversary 2017 Boston Team!  This dynamo decided to change her career midlife and open the most wonderful coffee cafe at the Gasworks Art Gallery, on the park. I had the best latte of my life made by Sunshine, the Queen of Baristas...but the show at this cafe is the customers' dogs, who, after walkies in the park, get a blueberry and bacon dog biscuit handmade by the cooking team. Erica, as  you can see, has a personal relationship with several bow-wow regulars. Talk about a perfect combination of ingenuity, great coffee, and personal friendships with all!  You go Erica and Team!!!  Stay Fearless!
Cheers, @KathrineSwitzer
