Gold Medal!! 🏅 
In case you didn't know it, my husband, Roger Robinson is my All Time Idol!!  At 83 and on 2 replaced knees, and after years of dedicated training, he took the 80+ Age Groups World Cross Country Championships like a 30 year old. Making his big move on a diabolical hill that followed a mud pond, Roger (wearing black NZ singlet) won by over a minute. For the first time in sports history, age group categories were introduced at the WX-Country Champs in Bathurst, NSW, Australia. Bravo, Roger!
Love, @KathrineSwitzer
