One of the greatest things about coming to big events is getting to see old friends again, sometimes after 20 or 30 years..and sometimes after just a few weeks. Here in Bathurst, Australia at the World Cross Country Champs I caught up with  Krishna Stanton (pink top) who was 8th in the the 1987 champs and ran with me in the New York  Mini 10k in 1990, and saw Lorraine Moller, Olympic Bronze Medal in the women's marathon in Barcelona, 1992. Lorraine was the Maid of Honor when Roger and I married in 1987!  And I love Roger with his gold medal that he won yesterday, with other age group runners from New Zealand. 
Cheers, @KathrineSwitzer
