Join the @Secret3K to support women’s running!@261fearless is one of the charity partners! We’re excited to share that there is now a brand new @261clubtoronto providing a safe and inclusive space for women to run and train together. 

@261fearless vision is to inspire, motivate and educate women to step up and become leaders to support women of all backgrounds to run and lead healthy, fearless and empowered lives. They train women to coach their own run club and now have clubs all around the world including in places women often feel unsafe to run. 

Help us continue to make a difference by inviting a friend to join you for this year’s @secret3k on March 8. Register and learn more at Secret3K.com

Cheers, @KathrineSwitzer
