I just finished reading the most amazing book—Bisia and Isham—written by Toni Reavis, our long time running friend and noted TV commentator on Running. Occasionally, Toni would tell me a little bit about his amazing parents in World War II. Most people my age and Toni’s had parents whose defining moment was WWII and I thought my parents’ story was exceptional until I read this one about his, which is just astonishing! It’s full of daring, close escapes, and the demise of an older generation and national identity. It is full of sadness but also hope, bravery and vitality. I couldn’t put it down! Bravo, Toni, you did your parents proud! Get it at Amazon! 
