A sad, sad day for runners everywhere, as we have lost one of the great heroines and pioneers of women’s running:  Leslie Watson, the amazing distance runner and professional physiologist who ran-and ran well!- hundreds of road races in 60s,70s, 80s...up until her death on New Year’s Day 2024. Just by running, she changed centuries of myth about women’s so-called limitations. She was a super star for us in the London Avon International Marathon for Women in 1980 when we closed downtown London streets for a sports event for the first time in history. Read more from @RogerRobinsonRunning on Facebook and Andy Cairns.....
https://athleticsweekly.com/athletics-news/distance-running-icon-leslie-watson-dies-aged-78-1039974264/
