Did you know that most women in the world live in fearful situations? Most women. There are many places in the world where women are not allowed to run. We run for them at the virtual @Secret3K walk/run, celebrating the right to freely run on Match 6, International Women’s Day. 
https://www.secret3k.com

Join us for the Secret3K run/walk and support the right of all people to walk or run free of fear in their community. A portion of your donation at registration will directly support @261Fearless, to develop programs and provide women the opportunity to become fearless through running.

@261Fearless is a proud partner of the Secret3K providing women a safe space to run!

